import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to Schneider Truck</h1>
      </header>
      <nav className="App-nav">
        <a href="/destination" className="nav-button">Enter Your Destination</a>
        <a href="/report" className="nav-button">Report Time</a>
        <a href="/weather" className="nav-button">Weather Today</a>
        <a href="/about_us" className="nav-button">About US</a>
        <a href="/community_tips" className="nav-button">Community Tips</a>
        <a href="/driving_summary" className="nav-button">Driving Summary</a>
        <a href="/community_support" className="nav-button">Community Support</a>
      </nav>
    </div>
  );
}

export default App;
